// Función para crear un gauge
// Función para inicializar un gauge
let distritoSeleccionado = null;
function createGauge(elementId, value) {
  var chart = echarts.init(document.getElementById(elementId));
  var option = {
    series: [
      {
        type: 'gauge',
        min: 0,
        max: 100,
        splitNumber: 10,
        axisLine: {
          lineStyle: {
            width: 10,
            color: [
              [0.3, '#D50000'],  // Rojo
              [0.7, '#FFEB3B'],  // Amarillo
              [1, '#00C853']     // Verde
            ]
          }
        },
        axisLabel: {
          fontSize: 10,
          formatter: function(value) {
            return Math.round(value);
          }
        },
        pointer: {
          width: 3
        },
        detail: {
          formatter: '{value} %',
          fontSize: 18,
          fontWeight: 'bold',
          offsetCenter: [0, "50%"],
        },
        data: [{ value: Math.round(value) }]
      }
    ]
  };

  chart.setOption(option);
  window.addEventListener('resize', () => chart.resize());
}

