// Función para descargar datos en formato CSV
function descargarCSV() {
  let csvContent = "Distrito,Valor\n";
  Object.entries({ ...datosDistritosPasco, ...datosDistritosDac, ...datosDistritosOxapampa }).forEach(([key, value]) => {
    csvContent += `${value.nombre},${value.valor}\n`;
  });
  let blob = new Blob([csvContent], { type: 'text/csv' });
  let link = document.createElement('a');
  link.href = URL.createObjectURL(blob);
  link.download = "datos_distritos.csv";
  link.click();
}
// Evento de clic en los distritos del mapa
document.getElementById("mapa-container").addEventListener("click", function (event) {
  let distritoId = event.target.id; // ID del distrito clickeado en el SVG

  let distritoEncontrado = datosDistritosPasco[distritoId] ||
                           datosDistritosDac[distritoId] ||
                           datosDistritosOxapampa[distritoId];

  if (distritoEncontrado) {
      actualizarGauge2(distritoEncontrado.valor, distritoEncontrado.nombre, distritoId);
  }
});

